import About from "./components/About/About";
import TweetNavbar from "./components/Navbar/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
    return (
        <div>
            <BrowserRouter>
                <Header />
                <TweetNavbar />
                <About />
                <Footer />
            </BrowserRouter>
        </div>
    );
}

export default App;
